const parseChartResp = ({ prices }) => ({
  dataPoints: prices.map(({ snapshotTime: timestamp, closePrice: { bid: price } }) => ({
    timestamp,
    price,
  }))
});
const data = parseChartResp(charty).dataPoints;

export default (state={ dataPoints: [] }, { payload, type }) => {

  switch (type) {
    case CHART_REQUEST:
      return {
        ...state,
        isLoading: true,
      };
    case CHART_SUCCESS:
      return {
        ...payload,
        isLoading: false,
      };
    case CHART_FAILURE:
      return {
        error: 'Chart failed.',
        isLoading: false,
      }
    case CHART_UPDATE:
      const update = {
        price: +payload.price,
        timestamp: d3.timeFormat('%Y/%m/%d %H:%M:%S')(new Date(+payload.timestamp)),
      };

      return {
        ...state,
        dataPoints: [ ...state.dataPoints.slice(1), update ],
      };
    default:
      return state;
  }
}
